To terminate a C program, you typically use the `exit()` function from the standard C library. This function is part of the `<stdlib.h>` header file. When called, it terminates the program with an optional status code that can be used by the system to understand why the program ended.

Here's how you would use the `exit()` function:

```c
#include <stdio.h>
#include <stdlib.h>

int main() {
    // Your program logic here...

    // Terminate the program
    exit(0);  // Exit with a success status code

    return 0; // This line will never be reached if exit is called correctly
}
```

In this example, `exit(0)` is called at the end of the `main()` function. The number passed as an argument to `exit()` (in this case, `0`) is the status code that indicates the reason for termination. A value of `0` usually signifies successful termination, while other values might indicate specific errors or conditions under which the program was terminated.

It's important to note that once `exit()` is called, the program immediately ends, and no further code execution occurs. Therefore, it's crucial to ensure that all necessary cleanup and final actions are completed before calling `exit()`.
